export default class HolbertonCourse {
  constructor(name, length, students) {
    this._name = this._validateString(name);
    this._length = this._validateNumber(length);
    this._students = this._validateStudents(students);
  }

  get name() {
    return this._name;
  }

  set name(newName) {
    this._name = this._validateString(newName);
  }

  get length() {
    return this._length;
  }

  set length(newLength) {
    this._length = this._validateNumber(newLength);
  }

  get students() {
    return this._students;
  }

  set students(newStudents) {
    this._students = this._validateStudents(newStudents);
  }

  _validateString(value) {
    if (typeof value !== 'string') {
      throw new TypeError('Name must be a string');
    }
    return value;
  }

  _validateNumber(value) {
    if (typeof value !== 'number') {
      throw new TypeError('Length must be a number');
    }
    return value;
  }

  _validateStudents(value) {
    if (!Array.isArray(value)) {
      throw new TypeError('Students must be an array');
    }
    for (let i = 0; i < value.length; i += 1) {
      if (typeof value[i] !== 'string') {
        throw new TypeError('Each student must be a string');
      }
    }
    return value;
  }
}
